title:
  "Get counts by provided_by property"
description:
  "Get counts by provided_by property"
endpoint:
  "http://kg-hub-rdf.berkeleybop.io/blazegraph/sparql"
query: >
prefix bl: <https://w3id.org/biolink/vocab/>
SELECT (COUNT(?v2) AS ?v1) ?v0
  WHERE {
    ?v2 bl:provided_by ?v0
  } GROUP BY ?v0
ORDER BY DESC(?v1)
